import React from 'react';
import logo from './logo.png';
import { Container, Row, Col } from 'reactstrap';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          We have raised RM50,000 for the marginalized youth
        </p>

        <Container >
          <Row>
            <Col lg={3} md={6} sm={12} xs={12}>Test</Col>
            <Col lg={3} md={6} sm={12} xs={12}>Test</Col>
            <Col lg={3} md={6} sm={12} xs={12}>Test</Col>
            <Col lg={3} md={6} sm={12} xs={12}>Test</Col>
          </Row>
        </Container>

      </header>


    </div>
  );
}

export default App;
